[[package]]
name = "aws-sam-translator"
version = "1.42.0"
description = "AWS SAM Translator is a library that transform SAM templates into AWS CloudFormation templates"
category = "dev"
optional = false
python-versions = "*"

[package.dependencies]
boto3 = ">=1.5,<2.0"
